<script>
  import SystemInformation from './IndexPage/SystemInformation'
  import C from '../js/common.js'
  import sqlite from '../db/db.js'
  import config from '../config/config.js'
  import VueAvatar from '@lossendae/vue-avatar'

  export default {
    name: 'index-page',
    data () {
      return {
        isRouterAlive: true,
        netWork_RED: true,
        netWork_GREEN: false,
        nowLinkTo: '',
        network_status: 'please check your connection',
        dialogVisible: false,
        dialogVisible2: false,
        connURL: '',
        loading: true,
        indexPageLoading: true,
        netWork_warning: false,
        docShow: false,
        accountList: []
      }
    },
    created: function () {
      sqlite.createTable('CREATE TABLE IF NOT EXISTS usr (account_name CHAR, account_hint CHAR, address CHAR PRIMARY KEY UNIQUE, pubKey CHAR UNIQUE, pubKey_raw CHAR UNIQUE, privKey CHAR UNIQUE, balance_OG DOUBLE DEFAULT (0))').then((data) => {
        console.log(data)
        return sqlite.createTable('CREATE TABLE IF NOT EXISTS txHistory (txHash CHAR PRIMARY KEY UNIQUE, cStatus CHAR, cFrom CHAR, cTo CHAR, cAmount DOUBLE, ConfirmTime CHAR)')
      }).then((data) => {
        console.log(data)
        return sqlite.query('SELECT * FROM usr')
      }).then().catch((err) => {
        console.log('err=', err)
      })
      sqlite.createTable('CREATE TABLE IF NOT EXISTS conn (id INT PRIMARY KEY UNIQUE, url CHAR)').then((data) => {
        console.log(data)
        var initurl = config.OG_RPC.HttpProvider
        sqlite.execute('INSERT INTO conn VALUES (?,?)', [1, initurl])
        return sqlite.query('SELECT * FROM conn where id = 1')
        // return C.getNetInfo()
      }).then((data) => {
        console.log(data.data[0])
        this.nowLinkTo = data.data[0].url
        return C.getNetInfo()
      }).then((data) => {
        console.log(data)
        if (data === 4001) {
          this.netWork_GREEN = false
          this.netWork_RED = true
          this.netWork_warning = true
        } else {
          this.network_status = data.data
          this.netWork_GREEN = true
          this.netWork_RED = false
          this.loading = false
          this.indexPageLoading = false
          this.netWork_warning = false
        }
      }).then().catch((err) => {
        console.log('err', err)
        this.netWork_GREEN = false
        this.netWork_RED = true
        this.netWork_warning = true
      })
      sqlite.execute('CREATE TABLE IF NOT EXISTS contract (address CHAR PRIMARY KEY UNIQUE, name CHAR, abi CHAR, timeStamp CHAR)').then((data) => {
        console.log(data)
      })
      sqlite.query('SELECT * FROM usr').then((data) => {
        console.log(data)
        this.accountList = data.data
        if (data.data.length === 0) {
          this.docShow = true
        } else {
          for (var i = 0; i < data.data.length; i++) {
            var account = data.data[i]
            console.log(account)
            C.getBalance(account.address).then((result) => {
              console.log(result.data)
              var sql = 'UPDATE usr SET balance_OG = ' + result.data.balance + ' where address = ' + '"' + result.data.address + '"'
              console.log(sql)
              sqlite.execute(sql)
            })
          }
        }
      })
    },
    components: {
      SystemInformation,
      VueAvatar
    },
    methods: {
      open (link) {
        this.$electron.shell.openExternal(link)
      },
      networkStatus () {
        this.dialogVisible = true
      },
      setConnetction () {
        C.changeConn('http://' + this.connURL).then((data) => {
          if (data.result === 'success') {
            console.log(data.data)
            this.indexPageLoading = true
            this.dialogVisible2 = false
            this.$message({
              message: 'Connection setup successful. Please restart the client.',
              type: 'a',
              showClose: false,
              duration: 0
            })
          }
        })
      },
      goAccount () {
        C.checkTxStatus()
        this.$router.push({ path: '/account' })
      },
      goCreatAccount () {
        this.$router.push({ path: '/createAccount' })
      },
      goImportAccount () {
        this.$router.push({ path: '/importAccount' })
      },
      reload () {
        this.isRouterAlive = false
        this.$nextTick(function () {
          this.isRouterAlive = true
        })
      }
    }
  }
</script>

